function digest($id){
	$start = 0;
	$code = strval($start + intval($id));
	$code_s = sprintf('%03s', $code);
	$redundancy = "000";
	$redundancy[0] = strval(intval($code_s[0]) + 3*intval($code_s[1]) + 2*intval($code_s[2]));
	$redundancy[1] = strval(2*intval($code_s[0]) + 2*intval($code_s[1]) + 3*intval($code_s[2]));
	$redundancy[2] = strval(3*intval($code_s[0]) + intval($code_s[1]) + intval($code_s[2])+1);
	return $redundancy.$code_s;
}